hebsuperobject.biblemap.put("b50_4_6", new hebsuperobject(50,4,6,"אל תדאגו כי אם בתפלה ובתחנונים עם תודה תודיעו בכל דבר את משאלותיכם לאלהינו׃"));
hebsuperobject.biblemap.put("b50_4_7", new hebsuperobject(50,4,7,"ושלום אלהים הנשגב מכל שכל ינצר את לבבכם ואת מחשבותיכם במשיח ישוע׃"));
hebsuperobject.biblemap.put("b50_4_8", new hebsuperobject(50,4,8,"ובכן אחי כל אשר הוא אמת ונכבד וישר וטהור ונעים ואשר שמעו טוב כל מעשה צדק כל מעשה שבח על אלה תשימו לבבכם׃"));
hebsuperobject.biblemap.put("b50_4_9", new hebsuperobject(50,4,9,"אשר למדתם וקבלתם ושמעתם וראיתם בי את אלה תעשו ואלהי השלום יהיה עמכם׃"));
hebsuperobject.biblemap.put("b50_4_10", new hebsuperobject(50,4,10,"ואני שמחתי מאד באדנינו כי עתה הפעם החלפתם כח להשגיח עלי וגם משגיחים הייתם עד כה אך לא עלתה בידכם׃"));
hebsuperobject.biblemap.put("b50_4_11", new hebsuperobject(50,4,11,"ולא ממחסור אדבר כן כי למדתי להסתפק במה שיש לי׃"));
hebsuperobject.biblemap.put("b50_4_12", new hebsuperobject(50,4,12,"ידעתי לענות אף ידעתי להותיר מחנך אני בכל ענין ואופן הן לשבע הן לרעב הן להותיר הן לחסר׃"));
hebsuperobject.biblemap.put("b50_4_13", new hebsuperobject(50,4,13,"כל זאת אוכל בעזרת המשיח הנותן כח בקרבי׃"));
hebsuperobject.biblemap.put("b50_4_14", new hebsuperobject(50,4,14,"אבל היטבתם לעשות בהתחברכם אלי בצרתי׃"));
hebsuperobject.biblemap.put("b50_4_15", new hebsuperobject(50,4,15,"וידעתם גם אתם פילפיים כי בראשית הבשורה כצאתי ממקדוניא לא התחברה לי אחת מן הקהלות בעשק משא ומתן כי אם אתם בלבד׃"));
hebsuperobject.biblemap.put("b50_4_16", new hebsuperobject(50,4,16,"כי גם בתסלוניקי שלחתם לי את צרכי פעם ושתים׃"));
hebsuperobject.biblemap.put("b50_4_17", new hebsuperobject(50,4,17,"לא שאבקש את המתן אך אבקש הפרי אשר ירבה בחשבנכם׃"));
hebsuperobject.biblemap.put("b50_4_18", new hebsuperobject(50,4,18,"ואני קבלתי את הכל ויש לי די והותר ואני נמלאתי ריח ניחח בקבלי מידי אפפרודיטוס את כל אשר שלחתם זבח ערב ורצוי לאלהים׃"));
hebsuperobject.biblemap.put("b50_4_19", new hebsuperobject(50,4,19,"ואלהי הוא ימלא את כל צרככם כעשר כבודו במשיח ישוע׃"));
hebsuperobject.biblemap.put("b50_4_20", new hebsuperobject(50,4,20,"ולאלהים אבינו הכבוד לעולמי עולמים אמן׃"));
hebsuperobject.biblemap.put("b50_4_21", new hebsuperobject(50,4,21,"שאלו לשלום כל קדוש במשיח ישוע האחים אשר עמדי שאלים לשלומכם׃"));
hebsuperobject.biblemap.put("b50_4_22", new hebsuperobject(50,4,22,"כל הקדשים שאלים לשלומכם וביותר אלה אשר מבית הקיסר׃"));
hebsuperobject.biblemap.put("b50_4_23", new hebsuperobject(50,4,23,"חסד ישוע המשיח אדנינו עם כלכם אמן׃"));

